	TropoGal->lat_pix_init = 90;		//Map from 90 to -90 degrees
	TropoGal->lat_pix_end = -90;		//Map from 90 to -90 degrees
	TropoGal->lon_pix_init = 0;		//Map from 0 to 360 degrees
