		//SBASdata[pos].RRC[i] = 9999;
		//SBASdata[pos].UDRE[i] = -1;
		//SBASdata[pos].UDREsigma[i] = -1;
		//SBASdata[pos].oldPRC[i] = -1;
		//SBASdata[pos].oldRRC[i] = -1;
		//SBASdata[pos].oldUDRE[i] = -1;
		//SBASdata[pos].oldUDREsigma[i] = -1;
		//SBASdata[pos].oldaifactor[i] = -1;
