							orbitsTmp->Concatblock[ind][indK].t=tdadd(&orbitsTmp->Concatblock[ind][indK-1].t,orbitsTmp->intervalConcat);
							diffSample=tdiff(&orbitsTmp->block[ind][i].t,&orbitsTmp->Concatblock[ind][indK].t);
